RODRIGO MAIA, UM DOS GRANDES RESPONSÁVEIS POR TENTAR PREJUDICAR O AVANÇO DO PAÍS, RECEBE O “CARINHO” DO POVO.😂

O deputado federal pelo Rio de Janeiro e ex-presidente da Câmara Federal, Rodrigo Maia, foi hostilizado no Tivoli Ecoresort, localizado na Praia do Forte, litoral norte da Bahia. Acompanhado pela esposa, o parlamentar tentava iniciar o café da manhã, quando foi atacado com xingamentos pelos demais hóspedes.

Nos vídeos da ação e nas imagens é possível ouvir os xingamentos de “ladrão” e “filho da p*ta”. Em certo momento, uma mulher se aproxima do casal e inicia os questionamentos. “É gostoso tudo que você roubou do país?”, pergunta e em seguida se direciona para a esposa de Maia. “É gostoso ser casada com bandido?”.

Ao perceber a proporção do tumulto, Maia desistiu do café da manhã e saiu do local, fazendo o “L”, em referência ao ex presidiário Lula.

