Rodrigo Maia, one of the great responsible for trying to harm the country's advance, receives the “affection” of the people.

The federal deputy for Rio de Janeiro and former president of the Federal Chamber, Rodrigo Maia, was harassed at Tivoli Ecoresort, located on Praia do Forte, North Coast of Bahia. Accompanied by his wife, the parliamentarian was trying to start breakfast when he was attacked with curses by the other guests.

In the videos of the action and images you can hear the curses of "thief" and "son of the p*ta". At one point, a woman approaches the couple and starts the questions. “Is everything that you stole from the country?” He asks and then goes to Maia's wife. "Is it nice to be married to a thug?"

Upon noticing the proportion of the turmoil, Maia gave up breakfast and left the place, making the "L", in reference to former inmate Lula.

