Post in Portuguese:
SEGURA ESSA, JANONES!!!!

O deputado federal André Janones tem insistido em conversar com o ex-presidiário Lula, em busca de apoio à disputa pela presidência da Comissão de Constituição e Justiça e de Cidadania da Câmara. Um dos principais responsáveis por movimentar as redes sociais durante a campanha eleitoral e espalhar fake news contra o então presidente Bolsonaro, Janones ficou de fora da lista de ministros do governo federal.

Não há, no entanto, nenhum encontro marcado na agenda oficial de Lula. Janones desistiu de concorrer à Presidência da República para apoiá-lo. O comunicado foi feito ao lado do petista. Janones chegou a integrar o grupo técnico de comunicação social da equipe de transição de governo, mas ficou de fora no rateio dos altos cargos.

O apoio pleiteado para a presidência da CCJ enfrenta barreiras. Isso porque, nos bastidores, o nome que circula para o comando da principal comissão da Câmara é a deputada federal Maria do Rosário. A parlamentar já tem apoio de colegas de dentro da Casa e do próprio diretório nacional do PT, mas a indicação ainda precisa ser discutida com o PCdoB e o PV, demais legendas que integram a federação. 

Mesmo que obtenha o apoio do presidente, Janones ainda deve enfrentar a disputa com a oposição pelo cargo. Tradicionalmente, o bloco com mais parlamentares fica com o comando da mais importante comissão, o que posicionaria o PL, de Bolsonaro e Valdemar Costa Neto, como favorito para a indicação.   

