Post in English:
Hold this one, Janones !!!!

Federal Deputy André Janones has insisted on talking to former convict Lula, seeking support for the dispute for the presidency of the Chamber's Constitution and Justice and Citizenship Commission. One of the main responsible for moving social networks during the election campaign and spreading fake news against then -Bolsonaro president, Janones was left out of the list of ministers of the federal government.

There is, however, no meeting scheduled on Lula's official agenda. Janones gave up running for the Presidency of the Republic to support him. The statement was made next to the petista. Janones joined the technical communication group of the government transition team, but was left out in the apportionment of the high positions.

Support claimed for the presidency of the CCJ faces barriers. This is because, behind the scenes, the name that circulates for the command of the main commission of the House is the federal deputy Maria do Rosário. The parliamentarian already has the support of colleagues from inside the house and the PT's own national directory, but the nomination still needs to be discussed with PCdoB and PV, other subtitles that make up the Federation.

Even if he gets the support of the president, Janones must still face the dispute with the opposition for the position. Traditionally, the block with the most parliamentarians has the command of the most important commission, which would position the PL, by Bolsonaro and Valdemar Costa Neto, as a favorite for the nomination.

