Post in Portuguese:
O COMUNISTA É CONTRA MANIFESTAÇÕES POPULARES.

Flávio Dino, ministro da Justiça, assinou uma portaria autorizando o uso da Força Nacional na Esplanada dos Ministérios entre este sábado e segunda-feira. 

A medida tem o objetivo de evitar protestos organizados por patriotas apoiadores do ex-presidente Jair Bolsonaro, que se opõem a eleição fraudulenta do ex-presidiário Lula.

A portaria autoriza a utilização da tropa “na proteção da ordem pública e do patrimônio público e privado entre a Rodoviária de Brasília e a Praça dos Três Poderes, assim como na proteção de outros bens da União situados em Brasília, em caráter episódico e planejado, nos dias 7, 8 e 9 de janeiro de 2023″.

“Além de todas as forças federais disponíveis em Brasilia, e da atuação constitucional do Governo do Distrito Federal, teremos nos próximos dias o auxílio da Força Nacional. Assinei agora Portaria autorizando a atuação, em face de ameaças veiculadas contra a democracia.”

