Post in English:
The communist is against popular manifestations.

Flávio Dino, Minister of Justice, signed a ordinance authorizing the use of the National Force in the Esplanade of Ministries between this Saturday and Monday.

The measure aims to avoid protests organized by supporters of former President Jair Bolsonaro, who oppose the fraudulent election of former convict Lula.

The Ordinance authorizes the use of the troop “in the protection of public order and public and private heritage between the bus station of Brasilia and the Praça dos Três Powers, as well as in the protection of other union goods located in Brasilia, in an episodic and planned basis, on January 7, 8 and 9, 2023 ″.

“In addition to all the federal forces available in Brasilia, and the constitutional action of the Federal District Government, we will have in the coming days the aid of the National Force. I have now signed ordinance authorizing the performance in the face of threats conveyed against democracy. ”

